      List<Results>? results,}){
    _title = title;
    _id = id;
    _author = author;
    _links = links;
    _copyright = copyright;
    _country = country;
    _icon = icon;
    _updated = updated;
    _results = results;
}

  Feed.fromJson(dynamic json) {
    _title = json['title'];
    _id = json['id'];
    _author = json['author'] != null ? Author.fromJson(json['author']) : null;
    if (json['links'] != null) {
      _links = [];
      json['links'].forEach((v) {
        _links?.add(Links.fromJson(v));
      });
    }
    _copyright = json['copyright'];
    _country = json['country'];
    _icon = json['icon'];
    _updated = json['updated'];
    if (json['results'] != null) {
      _results = [];
      json['results'].forEach((v) {
        _results?.add(Results.fromJson(v));
      });
    }
  }
  String? _title;
  String? _id;
  Author? _author;
  List<Links>? _links;
